import React, { useState } from 'react'

function TextInput() {
  const [text, setText] = useState('...')

  return (
    <div>
      <p>Input: {text}</p>
      <input placeholder="Serch" setText={() => text.target.value} />
    </div>
  )
}

export default TextInput
